[PC GAMES] Mad Truckers

This game have 15 Mission in the campaning and they are short and easy, you have some timer clock in the game.
After you complete the levels you will be rewarded by money and with those money you can in the workshop upgrade and buy parts.
In the workshop menu you can select 12 super paints for your truck.

